import React from 'react'
import "./header.css"
function Header() {
    return (
        <div className="header-container">
            <div className="header"></div>
            <div className="header-logo">
                Expenser <div>Icons made by <a href="https://www.flaticon.com/authors/freepik" title="Freepik">Freepik</a> from <a href="https://www.flaticon.com/" title="Flaticon">www.flaticon.com</a></div>
            </div>
        </div>
    )
}

export default Header
